import React, { useEffect, useState } from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import axios from './mockApi'; // Use the mocked axios instance

// Placeholder function to simulate fetching data (You can replace this with actual API call)
const fetchData = async () => {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve({
        items: 10,
        value: 1000,
      });
    }, 1000);
  });
};

const Dashboard = () => {
  // State to hold data
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [muddamaalData, setMuddamaalData] = useState([])
  // Fetch data from mock API
  useEffect(() => {
    axios.get('/api/muddamaal')
        .then(response => {
            setMuddamaalData(response.data);
            setLoading(false);
        })
        .catch(error => console.log(error));
    }, []);

  // useEffect to fetch data when component mounts
  useEffect(() => {
    const getData = async () => {
      try {
        const result = await fetchData();
        setData(result);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching data', error);
        setLoading(false);
      }
    };

    getData();
  }, []);

  return (
    <div className="dashboard-container">
        <div className="top-bar">
            <h2>Dashboard - Sector 7 Gandhinagar</h2>
            <Button variant="danger" className="logout-button">Log Out</Button>
        </div>

        <div className="content">
            <div className="actions-header">
                <Button variant="success" className="add-button">+ Add Muddamaal</Button>
            </div>

            <Table responsive bordered hover>
                <thead>
                    <tr>
                        <th>Sr. No</th>
                        <th>Crime No</th>
                        <th>Crime Date</th>
                        <th>Muddamaal No</th>
                        <th>Category</th>
                        <th>Quantity</th>
                        <th>Value</th>
                        <th>Status</th>
                        <th>Date & Time of Custody</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {muddamaalData.map((item, index) => (
                        <tr key={item.id}>
                            <td>{index + 1}</td>
                            <td>{item.crimeNo}</td>
                            <td>{item.crimeDate}</td>
                            <td>{item.muddamaalNo}</td>
                            <td>{item.category}</td>
                            <td>{item.quantity}</td>
                            <td>â‚¹ {item.value}</td>
                            <td>{item.status}</td>
                            <td>{item.custodyDate}</td>
                            <td>
                                <Button variant="info" size="sm">Edit</Button>{' '}
                                <Button variant="danger" size="sm">Delete</Button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </Table>

            {/* Pagination */}
            <Pagination className="justify-content-center">
                <Pagination.Prev />
                <Pagination.Item>{1}</Pagination.Item>
                <Pagination.Item>{2}</Pagination.Item>
                <Pagination.Item>{3}</Pagination.Item>
                <Pagination.Next />
            </Pagination>
        </div>
    </div>
    );
};

export default Dashboard;
